import React from "react";
import { useState, useEffect } from "react";


const data = [
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
];

export const Carousel = () => {
  const [currImg, setCurrImg] = useState(0);

  const getNextImg = () => {
    setCurrImg(currImg !== data.length - 1 ? currImg + 1 : 0);
  };

  const getPrevImg = () => {
    setCurrImg(currImg !== 0 ? currImg - 1 : data.length - 1);
  };

  useEffect(() => {
    const intervalId = setTimeout(() => {
      getNextImg();
    }, 5000);

    // Cleanup function to clear the interval on component unmount or when currImg changes
    return () => clearInterval(intervalId); 
  }, [currImg]);

  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        margin: "100px",
      }}
    >
      <button onClick={getPrevImg}>PREV</button>
      {/* <img style={{height:'200px', margin:'10px'}} src={data[currImg]} alt='pics'/> */}
      {data.map(
        (url, ind) =>
          url === data[currImg] && <img key={url} src={url} alt="pic" style={{height:'300px', margin:'10px'}}/>
      )}
      <button onClick={getNextImg}>NEXT</button>
    </div>
  );
};
